import React from 'react'
import './tradeblock.css'

const TBmenu = () => {
    return(
        <div className="TBmenu scrollmenu scroll">
            <span>Trades</span>
            <span>Offers</span>
            <span>simNFL</span>
            <span>simNBA</span>
        </div>
    )
}

export default TBmenu
